import "./index.css";
import { useState } from "react";
import ProjectCard from "../ProjectCard";
import ProjectContext from "../../context/ProjectContext";
import Header from "../Header";

export default function Projects() {
  const [projectsList, setProjectsList] = useState([
    {
      id: 1,
      projectName: "Project Name",
      projectDescription:
        "I created this personal project in order to show how to create an interface in Figma using a portfolio as an example.",
      ProjectLink: "Project Link",
      ProjectImg: "https://iili.io/J54fEXa.png",
    },
    {
      id: 2,
      projectName: "Project Name",
      projectDescription:
        "What was your role, your deliverables, if the project was personal, freelancing.",
      ProjectLink: "Project Link",
      ProjectImg: "https://iili.io/J54fOmX.png",
    },
    {
      id: 3,
      projectName: "Project Name",
      projectDescription:
        "You can also add in this description the type of the project, if it was for web, mobile, electron.",
      ProjectLink: "Project Link",
      ProjectImg: "https://iili.io/J54fUBf.png",
    },
  ]);
  return (
    <div className="route2">
      <Header />
      <div className="responsive">
        <h2 className="projectsPageTitle">Projects</h2>
        <div className="">--</div>

        {projectsList.map((eachItem) => (
          <ProjectCard projectDetails={eachItem} key={eachItem.id} />
        ))}
      </div>

      <div>
        <div></div>
        <p className="copyright">Copyright Â© 2024. All rights reserved</p>
      </div>
      <img src="https://iili.io/J5LuC79.png" alt="Footer" className="footer" />
    </div>
  );
}
